import React from 'react';
import './Home.module.css';
import { Link } from "react-router-dom";
import styles from "./Home.module.css";


const BASE_URL = "http://localhost:3001";
const ABOUT_GYM_API = "/";


function Home() {
    return (

        <main>
            <div className={styles.logo}>
                    <Link to="/" className={styles.logoLink}>
                    <img src="/Gym1.png" alt="Gym" className={styles.logoImage} />
                    </Link>
                </div>
            <section className={styles.container}>
                <section className={styles.p1}>
                    <h2>About Us</h2>
                    <p>We are a fitness center that offers a variety of programs for people of all fitness levels. Our experienced trainers can help you achieve your fitness goals, whether it's losing weight, gaining muscle, or just staying in shape.</p>
                </section>
                <section className={styles.p2}></section>
                <h2>Our Programs</h2>
                <ul>
                    <li>Weight Training</li>
                    <li>Cardiovascular Training</li>
                    <li>Yoga and Pilates</li>
                    <li>Zumba</li>
                    <li>Group Fitness Classes</li>
                </ul>
                <h2>Contact Us</h2>
                <p>Feel free to contact us if you have any questions or would like to sign up for one of our programs:</p>
                <ul>
                    <li>Phone: 555-1234</li>
                    <li>Email: info@fitnessworld.com</li>
                    <li>Address: 123 Main Street, Anytown USA</li>
                </ul>
            </section>
        </main>
    );
}

export default Home;
